import styled from "styled-components";

export const Button = styled.button`
  width: 100%;
  letter-spacing: 0;
  line-height: 23px;
  text-align: center;
  padding: 0.8em 0;
  cursor: pointer;
  background-color: blue;
  color: white;
  border-radius: 10px;
  font-size: 18px;
  font-family: "Roboto-Bold";

`;

export default Button;
